module.exports = JSON.parse('{"tensorflow":{"geninfo":{"name":"TensorFlow","developer":"<a href=\\"https://about.google/\\" class=\\"center-underline\\" target=\\"_blank\\">Google</a>"},"lang":["Python","C++","Java","Go","Javascript"],"documentation":{"context":"TensorFlow provides good <a href=\\"https://www.tensorflow.org/api_docs/python/tf\\" class=\\"center-underline\\" target=\\"_blank\\">APIs for Python</a> and C++. It documents all of the modules, classes, and functions. The documentation includes many details and examples which help developers to understand how to use the functions. Furthermore, there is also a well-documented TensorFlow.js API. ","link":"<a href=\\"https://www.tensorflow.org/api_docs/python/tf\\" class=\\"center-underline\\" target=\\"_blank\\">link</a>"},"user":"TensorFlow is widely used in industry. Many companies, such as Airbnb, Google, CocaCola, DeepMind are using TensorFlow to develop projects. ","programming":{"context":"TensorFlow supports both the symbolic and imperative ways of creating models. In TensorFlow, a neural network can be built symbolically in the syntax shown in the example below.","code":"model = tf.keras.models.Sequential([<br> &nbsp &nbsp tf.keras.layers.Flatten(input_shape=(28, 28)),<br> &nbsp &nbsp tf.keras.layers.Dense(128, activation=\'relu\'),<br> &nbsp &nbsp tf.keras.layers.Dropout(0.2),<br> &nbsp &nbsp tf.keras.layers.Dense(10)])"},"tutorial":{"context":"Tensorflow has <a href=\\"https://www.tensorflow.org/tutorials\\" class=\\"center-underline\\" target=\\"_blank\\">tutorials</a> in videos, blogs and websites. Although they did a good job of segmenting the tutorials in different subject areas, such as Natural Language Processing and Computer Vision, explanations in each section are very abstract. TensorFlow also provided tailored tutorials for expert and beginner users.","link":"<a href=\\"https://www.tensorflow.org/tutorials\\" class=\\"center-underline\\" target=\\"_blank\\">tutorials</a>"},"community":{"list":["<a href=\\"https://www.tensorflow.org/community/groups\\" class=\\"center-underline\\" target=\\"_blank\\">Tensorflow Group</a>"],"context":"Tensorflow has a platform called Tensorflow group. Different locations around the world have their own Tensorflow group for people to discuss developing AI with TensorFlow.","link":"<a href=\\"https://www.tensorflow.org/community/groups\\" class=\\"center-underline\\" target=\\"_blank\\">link</a>"},"distributed":{"context":"Tensorflow supports <a href=\\"https://www.tensorflow.org/guide/distributed_training\\" class=\\"center-underline\\" target=\\"_blank\\">distributed training</a> and has a tutorial page about it. It supports different strategies, such as mirrored Strategy, TPU Strategy, multi worker mirrored strategy, central storage strategy, and parameter storage strategy.","link":"<a href=\\"https://www.tensorflow.org/guide/distributed_training\\" class=\\"center-underline\\" target=\\"_blank\\">distributed ML</a>"},"takeaway":{"advantage":"&#9989; Easy to use for beginners <br> &#9989; Easy to find the specific tutorial in the webpage <br> &#9989; Supportive community for developers","disadvantage":"&#10060; Explanations are hard to follow and need to include graphic models <br> &#10060; Hard to incorporate customized design for neural network models"}},"pytorch":{"geninfo":{"name":"PyTorch","developer":"<a href=\\"https://about.fb.com/company-info/\\" class=\\"center-underline\\" target=\\"_blank\\">Facebook</a>"},"lang":["Python","C++","CUDA"],"documentation":{"context":"In <a href=\\"https://pytorch.org/docs/stable/index.html\\" class=\\"center-underline\\" target=\\"_blank\\">PyTorch’s documentation</a>, there are different API function calls to build AI models. The mostly used function call is torch.nn, which is the building block for deep neural networks.","link":"<a href=\\"https://pytorch.org/docs/stable/index.html\\" class=\\"center-underline\\" target=\\"_blank\\">PyTorch’s documentation</a>"},"user":"PyTorch is widely used in research institutions to develop new algorithms in AI given the flexibility it provides to developers. Salesforce, Stanford University, and Udacity are the example user groups of PyTorch.","programming":{"context":"Pytorch supports both symbolic and imperative ways of creating the model. In other machine learning libraries, developers don’t need to create the class to define the structure of the neural network. Here is an example of the symbolic way of building neural network in PyTorch:","code":"class NN(nn.Module):<br> &nbsp &nbsp def __init__(self):<br> &nbsp &nbsp &nbsp &nbsp super().__init__() <br> &nbsp &nbsp &nbsp &nbsp self.lin = nn.Linear(784, 10) <br> &nbsp &nbsp def forward(self, xb): <br> &nbsp &nbsp &nbsp &nbsp return self.lin(xb)"},"tutorial":{"context":"<a href=\\"https://pytorch.org/tutorials/\\" class=\\"center-underline\\" target=\\"_blank\\">PyTorch tutorials</a> are very clear and easy to understand. The tutorial has an overview and detailed illustration about different applications in PyTorch, such as NLP and computer vision. In each tutorial about the specific application, there are some graphical illustrations about the model, which are helpful for readers to understand. However, in the tutorial, they should segment the code more to explain them separately, which can allow users to follow the code better.","link":"<a href=\\"https://pytorch.org/tutorials/\\" class=\\"center-underline\\" target=\\"_blank\\">PyTorch tutorials</a>"},"community":{"list":["<a href=\\"https://discuss.pytorch.org/\\" class=\\"center-underline\\" target=\\"_blank\\">PyTorch Forum</a>","<a href=\\"https://pytorch.org/blog/\\" class=\\"center-underline\\" target=\\"_blank\\">PyTorch Blog</a>"],"context":"PyTorch Forum is a widely used platform for developers. They ask questions about how to solve issues when developing the projects and discuss some ideas about future projects. PyTorch blog has updated information about the development of PyTorch.","link":"<a href=\\"https://discuss.pytorch.org/\\" class=\\"center-underline\\" target=\\"_blank\\">link</a>"},"distributed":{"context":"PyTorch has a <a href=\\"https://pytorch.org/tutorials/beginner/dist_overview.html#\\" class=\\"center-underline\\" target=\\"_blank\\">torch.distribute package</a> for developing distributed ML. The package has three components: distributed data-parallel training, RPC-based distributed training, and collective communication.","link":"<a href=\\"https://pytorch.org/tutorials/beginner/dist_overview.html#\\" class=\\"center-underline\\" target=\\"_blank\\">torch.distribute package</a>"},"takeaway":{"advantage":"&#9989; Flexible to design customized neural network model <br> &#9989; Good graphical explanations in the tutorial page","disadvantage":"&#10060; Harder for beginners to learn <br> &#10060;  The long code section in the tutorial is hard to follow and needs to be separated to smaller sections"}},"mxnet":{"geninfo":{"name":"MXNet","developer":"<a href=\\"https://www.apache.org/foundation/\\" class=\\"center-underline\\" target=\\"_blank\\">Apache Software Foundation</a>"},"lang":["Python","C++","Java","Go","Javascript","R","Scala","Julia","Perl","Clojure"],"documentation":{"context":"Currently, MXNet provides a good <a href=\\"https://mxnet.apache.org/versions/1.7.0/api\\" class=\\"center-underline\\" target=\\"_blank\\">Python API</a> for developers. Its Gluon API is clear and simple for building ML models. The documentation for Python API is relatively comprehensive and easy to read. The frequently used functions are documented with examples. However, documentations for other programming languages are not as comprehensive.","link":"<a href=\\"https://mxnet.apache.org/versions/1.7.0/api\\" class=\\"center-underline\\" target=\\"_blank\\">Python API</a>"},"programming":{"context":"MXNet provides a NumPy-like programming interface. Developers who know NumPy can quickly learn to use MXNet. Its automatic hybridization also allows developers to program imperatively, but the performance is close to traditional symbolic programming. A neural network is created using the syntax shown in the example below.","code":"net = gluon.nn.Sequential()<br>with net.name_scope():<br>&nbsp &nbsp net.add(gluon.nn.Dense(256, \'relu\'))<br>&nbsp &nbsp net.add(gluon.nn.Dense(256, \'relu\'))<br>&nbsp &nbsp net.add(gluon.nn.Dense(num_outputs))"},"user":"MXNet is mainly used by many large companies in the industry. It is used as part of larger analytics suites, like Wolfram. It is also used by Amazon for image analysis. Furthermore, some Apple devices use its deep learning models. In the research field, it also had some usages because of its scalability and support for GPU.","tutorial":{"context":"MXNet provides some <a href=\\"https://mxnet.apache.org/versions/1.7.0/api/python/docs/tutorials/\\" class=\\"center-underline\\" target=\\"_blank\\">tutorials</a> of the main usages of the framework. The tutorials are enough for developers to get started. In order to understand more details, developers need to read the documentation. On the Internet, there are a small number of tutorials provided by MXNet users, but tutorials are expected to become more available in the future.","link":"<a href=\\"https://mxnet.apache.org/versions/1.7.0/api/python/docs/tutorials/\\" class=\\"center-underline\\" target=\\"_blank\\">tutorials</a>"},"community":{"list":["<a href=\\"https://discuss.mxnet.apache.org\\" class=\\"center-underline\\" target=\\"_blank\\">MXNet Discuss Forum</a>","<a href=\\"https://github.com/apache/incubator-mxnet\\" class=\\"center-underline\\" target=\\"_blank\\">MXNet Github</a>"],"context":"MXNet has a forum for discussions related to ML and the Gluon API. Developers can also report bugs, request features, and discuss issues on the GitHub repository of MXNet. Furthermore, there is a slack workspace for discussions of advanced topics, but requests for access require permission.","link":"<a href=\\"https://discuss.mxnet.apache.org\\" class=\\"center-underline\\" target=\\"_blank\\">link</a>"},"distributed":{"context":"MXNet supports <a href=\\"https://mxnet.apache.org/versions/1.7.0/api/faq/distributed_training\\" class=\\"center-underline\\" target=\\"_blank\\">distributed training</a>. Users can launch training jobs on multiple machines to shorten training time. Currently, MXNet supports data parallelism on multiple machines, and supports model parallelism only on a single machine. It provides a key-value store for communication of parameters.","link":"<a href=\\"https://mxnet.apache.org/versions/1.7.0/api/faq/distributed_training\\" class=\\"center-underline\\" target=\\"_blank\\">distributed training</a>"},"takeaway":{"advantage":"&#9989; Clear documentation for the frequently used APIs <br> &#9989; Support for many different programming languages <br> &#9989; Good support for distributed ML","disadvantage":"&#10060; Relatively low tutorial availability <br> &#10060; Some documentation do not show examples and they can be difficult for beginners to understand"}}}');

